import React, { Component, Fragment } from 'react';
import { Row, Card, CardBody, CardTitle } from "reactstrap";
import IntlMessages from '../../helpers/IntlMessages';
import { Colxx, Separator } from '../../components/common/CustomBootstrap';
import Breadcrumb from '../../containers/navs/Breadcrumb';
import ChannelPageHeading from "../../containers/pages/ChannelPageHeading";

import TagsInputExample from "../../containers/forms/TagsInputExample";

export default class ChannelPage extends Component {
  render() {
    const { match } = this.props;
    return (
      <Fragment>
        <ChannelPageHeading
          heading="menu.channel"
          match={match}
        />
        <Row>
          <Colxx xxs="12" className="mb-4">
            <p>
              <IntlMessages id="menu.channel" />
            </p>
          </Colxx>
        </Row>
        <Row className="mb-4">
          <Colxx xxs="12">
            <Card>
              <CardBody>
                <CardTitle>
                  <IntlMessages id="form-components.tags" />
                </CardTitle>
                <TagsInputExample />
              </CardBody>
            </Card>
          </Colxx>
        </Row>
      </Fragment>
    );
  }
}
